--
-- Name: aluno; Type: TABLE; Schema: public; Owner: postgres
--

CREATE TABLE public.aluno (
    idaluno INTEGER NOT NULL,
    nombre character varying(300),
    sexo integer not null REFERENCES sexo,
    idade integer,
    moradia integer not null REFERENCES moradia,
    trabalha character varying(1),
    estadocivil integer not null REFERENCES estadocivil,
    escola integer not null REFERENCES escola,
    religiao integer not null REFERENCES religiao,
    cursograduacao integer not null REFERENCES cursograduacao,
    modalidade integer not null REFERENCES modalidade,
    periodoingresso character varying(6),
    notaexameadmissao numeric(7,2),
    totalniveiscurso integer,
    totalcreditoscurso integer,
    totalniveiscursados integer,
    porcentagemniveiscursados numeric(7,2),
    totalcreditoscursados integer,
    porcentagemcreditoscursados numeric(7,2),
    periodoultimamatricula character varying(6),
    ultimonivelestudado integer,
    promedioultimoperiodo numeric(7,2),
    class character varying(50),
	PRIMARY KEY(idaluno)
);

ALTER TABLE public.aluno OWNER TO postgres;


